import React from "react";

const AmbulanceBooking = () => {
  return (
    <div className="section ambulance">
      <h2>Book Ambulance</h2>
      <button className="emergency-button">Emergency</button>
      <form>
        <input type="text" placeholder="Patient Name" required />
        <input type="tel" placeholder="Contact Number" required />
        <select required>
          <option value="">Select Location</option>
          <option value="hospital">Nearest Hospital</option>
          <option value="home">Pick-Up from Home</option>
        </select>
        <button type="submit">Request Ambulance</button>
      </form>
    </div>
  );
};

export default AmbulanceBooking;
